import { Text } from "../style_compomemts/text"
import { Textbox } from "../style_compomemts/textbox"

/***************************************************************/
export function CardName(props) {
    return (
        <Stack dire spacing={2}>
            <Box>
                <Text>Name :</Text>
            </Box>
            <Textbox setValue={(value) => props.setCardName(value)} placeholder="Enter the name of your card here."/>
         </Stack>
    );
}
